Fixes #36 

This patch adds a plugin to the server that uses hapi's built in caching for rate limiting.

It's off by default for all routes, and can be configured on a per route basis to limit against any configured parameters.

it can be enabled on a route using `config.plugins`:

```
server.route({
  path: '/foo',
  method: 'post',
  handler: handlerFunc,
  config: {
    auth: {
      mode: 'required',
      strategies: ['token']
    },
    plugins: {
      'webmaker-ratelimit': {
        enable: true
      }
    }
  }
});
```

the default ttl (15 minutes), limit (15) and generateKeyFunc ( looks up ip) can be overridden:

```
server.route({
  path: '/footwo',
  method: 'post',
  handler: handlerFunc,
  config: {
    auth: {
      mode: 'required',
      strategies: ['token']
    },
    plugins: {
      'webmaker-ratelimit': {
        enable: true,
        ttl:1000 * 60 * 60,
        limit: 100,
        generateKeyFunc: function(request) {
          return request.path + request.auth.credentials.id;
        }
      }
    }
  }
});
```

